import React from 'react';
import './Media.css'
import { SocialIcon } from 'react-social-icons';



const Media = ({onRouteChange}) => {

	return(
		<div>
			<div onClick = {() => onRouteChange('singout')}  className = 'mygo'>
			  {'My Go'}
			</div>
			<div className = 'media'>
	             <SocialIcon className = 'google b ph3 pv2 input-reset  bg-transparent grow pointer f6 dib' network="google" bgColor="#fff" />
	             <SocialIcon className = 'facebook b ph3 pv2 input-reset  bg-transparent grow pointer f6 dib' network="facebook" bgColor="#fff" />

			</div>
		</div>



		);



}

export default Media;
